import React from 'react';
import styled from 'styled-components';
import Username from '../Username';
import Avatar from '../Avatar'

const Post = props => {
    return (
           
        <PostHeader>
            <Username name='Alexandre'></Username>
            <Avatar url='https://www.web-soluces.net/webmaster/avatar/AvatarMakerCom-Garcon.png'></Avatar>
            
        </PostHeader>
      
        
    );
};
const PostBody1 =props =>{
    return(
        <PostBody>
            <PostImg img src='https://france3-regions.francetvinfo.fr/image/pRSlHUAmBSQkt9GgJdwwFz7meT8/930x620/regions/2020/06/09/5edfa1437fe2a__g9b1055-4583991.jpg'></PostImg>
        </PostBody>
    )
}
const PostImg =styled.img`
align-items: center;
padding:20px;
widh:100px;
`

const PostHeader =styled.div`
    display: flex;
    align-items: center;
    padding:20px;
`

const PostBody =styled.div`
    
    align-items: right;
    padding:50px;
`

export default Post;
